--the movement shit
function onEvent(n,v1,v2)
    if n=="windowmove" then
        runTimer('winstop',0.00001);--runs a 0.00001 second timer
       
        l=getRandomInt(1, 101)
        if v1== '' then
            a=getRandomInt(1, 101)
        end
        if v1~=''then
            a=v1
        end
        m=getRandomInt(1, 101)
        if v2=='' then
            p=getRandomInt(1, 101)
        end
        if v2 ~='' then
            p=v2
        end
        if a==101 then
            a=150
        end
        if l==101 then
            l=150
        end
        if m==101 then
            m=15
        end
        if p==101 then
            p=150
        end
        h = randomnumbers4xaxis[l][a]--gets a random number from the matrix for the application window x value
        i = randomnumbers4yaxis[m][p]--gets a random number from the matrix for the application window y value
    end
end
function onTimerCompleted(tag, loops, loopsLeft)
    if tag == 'winstop' then
        setPropertyFromClass("openfl.Lib", "application.window.x", h)
        setPropertyFromClass("openfl.Lib", "application.window.y", i)
    end
end